import React from 'react'

const InputCell = (props) => {

  return (
    <div>
      <div>{props.data}</div>
      <input
        type={props.type == 'date' ? 'date' : 'text'}
        className="column border border-primary"
        style={{
          width: `${props.width}px`,
          textAlign: `start`,
        }}
        onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
        value={() => {
          if (props.type == 'date') {
            return props.data
          }
          else if (props.type == 'number') {
            return props.data
          }
          else if (props.type == 'money') {
            return props.data
          }
          else if (props.type == 'text') {
            return props.data
          }
          else if (props.type == 'percent') {
            return props.data
          }
        }
        }
      />

    </div>
  )
}

export default InputCell
